import React from 'react';
import Button from 'react-bootstrap/Button';
import LinkBtn from './LinkComponents/LinkBtn';

const LandingPage = () => {
 const user = {
    gitHub: "https://github.com/brandonRoulstone",
    linkedIn: "https://www.linkedin.com/in/brandon-roulstone-a8669a29b/"
  }

  const textContent = {
    intro: "Software developer & designer",
  }


  return (
 <>
    <div className="Landing-container">
      
      <div className="container-fluid m-5 p-5" id="childContainer">
        
        <div className="container-fluid">

        <div className="introduction">
          
          <div id="abth3" className="container text-white">Hi, I am B r a n d o n

          </div>

        </div>

        </div>

        <h3 className="fs-1">{textContent.intro}</h3>

        <div className="landing-body">

          <div className="content-pg-lnd">

            <div className="landing-content">

              <Button className="btn-btn" >
                
              </Button>

            </div>

          </div>

        </div>
      </div>
    </div>
    <LinkBtn />
   </>
  );
}

export default LandingPage;
